import React from "react";
import "./Card.css"; // Стилі для картки

const RocketCard = ({ rocket }) => {
  console.log("Image URL:", rocket.imageUrl); // Перевірка URL

  return (
    <div className="rocket-card">
      <div className="rocket-card__image">
        <img
          src={rocket.imageUrl}
          alt={rocket.name}
          onError={(e) => (e.target.src = "https://via.placeholder.com/300")}
        />{" "}
        {/* Якщо зображення не завантажується, заміна на плейсхолдер */}
      </div>
      <div className="rocket-card__info">
        <h2>{rocket.name}</h2>
        <p>Country: {rocket.country}</p>
        <p>Manufacturer: {rocket.manufacturer}</p>
        <p>Launches: {rocket.launchCount}</p>
      </div>
    </div>
  );
};

export default RocketCard;
